(1, 1, 1, '2014-02-11', '00:49:41', 'Bienvenu sur le site de Fireworks-bbc! Postez vos messages avec la toucher \\"Enter\\"', 0),
(2, 1, 20, '2014-03-03', '16:22:01', 'Yes!! Ça fonctionne déjà pas trop mal!! À quand le changement de photo??', 0),
(3, 1, 1, '2014-03-03', '16:45:53', 'La gestion du téléchargement et dimensionnement des photos est un peu relou à faire! Donc pas pour tout de suite ^^... Mais si la photo te gêne terriblement, tu peux toujours m\\''envoyer une photo par mail.', 0),
(4, 1, 20, '2014-03-03', '20:53:25', 'Non non, c\\''était juste pour te compliquer la vie... ;)', 0),
(5, 1, 4, '2014-03-24', '08:46:56', 'Coucou c''est cool le sit!', 0),
(6, 1, 1, '2014-03-31', '10:39:54', 'Bravo aux Fire Papy pour leur deuxième place au tournoi ! ', 0),
(7, 11, 20, '2014-04-01', '21:35:48', 'Attention!! Match annulé!!', 0),
(8, 14, 1, '2014-04-02', '09:38:42', 'Je me suis blessé à la main. C''est pas encore sûr que je puisse jouer le match. ', 0),
(10, 1, 1, '2014-04-03', '10:46:44', 'Photos du tournoi (dimanche) : <a href="http://www.rpcs-geneva.ch/albums/Tournoi-du-GAB-2014(P.Fellah)/" target="”_blank”">http://www.rpcs-geneva.ch/albums/Tournoi-du-GAB-2014(P.Fellah)/</a> ', 0),
(11, 1, 1, '2014-04-03', '11:16:47', 'Trop classe : <a href="http://www.rpcs-geneva.ch/albums/Tournoi-du-GAB-2014(P.Fellah)/#_DSC3263%20copie_GF.jpg" target="”_blank”">http://www.rpcs-geneva.ch/albums/Tournoi-du-GAB-2014(P.Fellah)/#_DSC3263%20copie_GF.jpg</a> ', 0),
(12, 3, 1, '2014-04-04', '10:39:05', 'Repas d''équipe le jeudi 15 mai.', 0),
(13, 16, 1, '2014-04-07', '17:20:23', 'Match forfait ! A ce soir pour l''entraînement. ', 0),
(14, 23, 16, '2014-04-14', '19:28:22', 'Les salles ne seront pas fermées le 1er mai??', 0),
(15, 17, 16, '2014-04-14', '19:29:47', 'Bon 3vs3 ce soir :P', 0),
(16, 1, 1, '2014-04-18', '11:28:18', 'J''ai modifier le système de session sur le site pour que la connexion soit maintenu pendant 1 mois. Ceci évite de se reconnecté à chaque visite. Par contre, si vous êtes sur un ordinateur publique, n''oubliez pas de vous déconnecter!', 0),
(17, 23, 1, '2014-04-18', '11:29:16', 'Si! Du coup les matchs vont être reporté!', 0),
(18, 22, 15, '2014-04-28', '14:29:17', 'J''ai une réu ce soir, je vous retrouve next week vu que le match est annulé... :-(', 0),
(19, 18, 20, '2014-04-30', '00:22:04', 'Match déplacé au 15.5.2014 selon le site du GAB!', 0),
(20, 25, 12, '2014-05-02', '16:34:46', 'Pas encore sur et certain de pouvoir être présent... Tout dépend de l''avancé de mes révisions =&gt; exa le lendemain.', 0),
(21, 25, 1, '2014-05-02', '16:46:26', 'Tu vas faire le gay en résumé! (Dis par celui qui est absent depuis 1 mois...)', 0),
(22, 25, 12, '2014-05-08', '09:36:52', 'Je confirme! I am a homo... :-(', 0),
(23, 25, 12, '2014-05-08', '09:37:07', 'Fisté les comme il se doit!!!', 0),
(24, 4, 1, '2014-05-08', '10:57:27', 'Merci Gianni pour la gestion du site pour l''équipe 2! ;-)', 0),
(25, 27, 1, '2014-05-09', '10:01:46', 'N''oubliez pas le repas d''équipe après le match!', 0),
(26, 27, 13, '2014-05-14', '21:38:49', 'Yo la team. J''ai pu me libérer pour le match. A demain ;)', 0),
(27, 27, 1, '2014-05-15', '12:50:34', 'Sexy ! Moi je vous rejoins pour la bouffe après le match. Fistez-les! ', 0),
(28, 1, 1, '2014-05-16', '13:49:42', 'Quelqu''un sais jusqu''à quand peut-on utiliser les salles de Sismondi?', 0),
(29, 1, 23, '2014-05-16', '17:11:36', 'Hello Jé, normalement jusqu''aux vacances scolaires.....', 0),
(30, 30, 10, '2014-05-19', '15:06:34', 'Légères inflammations des jambes après avoir jouer hier, repos pour être au top mardi.', 0),
(31, 1, 1, '2014-06-09', '11:39:11', 'Pendant l''été on peut se servir du site pour organiser des sessions de basket dehors! Alors restez connecté.', 0),
(32, 34, 1, '2014-06-09', '16:42:15', 'Evènement annulé!', 0),
(33, 42, 1, '2014-09-01', '14:14:34', 'Étant donné mes nombreuses absences en début de saison, je viendrai simplement coacher si le nombre de personnes présentes est conséquent ! ', 0),
(34, 42, 12, '2014-09-04', '11:22:47', 'Pas sur de pouvoir jouer mais je serai présent pour remplir les bouteilles d''eau!', 0),
(35, 42, 14, '2014-09-08', '09:04:48', 'Je jouerai si rétabli. Présent dans tous les cas.', 0),
(36, 42, 12, '2014-09-18', '10:22:02', 'Bon... Pour finir je ne pourrai pas être la pour faire la supportrice! Mais je vous souhaite un bon fisting!!! ', 0),
(37, 48, 15, '2014-09-29', '14:21:12', 'Je viendrai s''il faut faire le nombre', 0),
(38, 49, 17, '2014-09-30', '19:24:30', 'dai cazzoooooooo', 0),
(39, 50, 10, '2014-10-06', '13:40:13', 'Sans moi ce source... :(', 0),
(40, 50, 10, '2014-10-06', '13:40:51', '*soir.. Je suis malade', 0),
(41, 55, 4, '2014-10-16', '16:33:25', 'Je me suis blessé au pouce lundi....bon match les gars', 0),
(42, 60, 27, '2014-10-29', '19:33:03', 'le match est a 19h c est cas ', 0),
(43, 70, 10, '2014-11-23', '18:03:10', 'Salut les gars, je suis rentré des States aujourd''hui (dimanche). Je suis complètement Jetlagé mais si mon état me le permet je devrais être là demain ! A+', 0),
(44, 75, 12, '2014-12-08', '08:43:39', 'Je récupère toujours d''une tendinite aux mollets et ne serai pas présent à l''entrainement de ce soir. Du coup j''en profite pour vous souhaiter de bonnes fêtes de fin d''année! Profitez bien et on se voit l''année prochaine sur les parquets! A+ ', 0),
(45, 79, 24, '2014-12-15', '12:24:35', 'J''arriverai juste a l''heure pour le match ou un peu en retard si jamais. Alex', 0),
(46, 75, 24, '2014-12-15', '12:26:35', 'J''aurai du retard ce soir à cause de mon travail, je serai la vers 20h30-21h. Si je finis trop tard, je ne viendrai pas. A+', 0),
(47, 78, 24, '2014-12-15', '12:30:08', 'Je finis plus tard que prévu mon travail ce soir. Je serai a l''entraînement vers 20h30-21h. A+', 0),
(48, 1, 27, '2014-12-20', '11:57:19', 'bonnes fetes a tous ', 0),
